                                }}>Automotive Mechanical Engineering</h5>
                            </Cell>
                        </Grid>
                        <Grid>
                            <Cell col={4}>
                            <img src={umb} height="80px" width="90px"></img>
                            </Cell>
                            <Cell col={8}>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>University Of Mercu Buana</h5>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>Bachelor's Degree of Informatics</h5>
                            </Cell>
                        </Grid>

                        <hr
                            style={{
                            borderTop: '3px solid #e22947'
                        }}/>
