                        <Grid>
                            <Cell col={4}>
                                <NavLink href="https://www.dicoding.com">
                                    <img src ={dicoding} height="100px" width="100px"></img>
                                </NavLink>
                            </Cell>
                            <Cell col={8}>
                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>
                                    Dicoding Academy</h4>
