                                    style={{
                                    marginTop: '0px'
                                }}>Data Scientist</h5>
                            </Cell>
                        </Grid>
                        <Grid>
                            <Cell col={4}>
                                <NavLink href="https://binar.co.id/">
                                    <img src={binar} height="100px" width="100px"></img>
                                </NavLink>
                            </Cell>
