                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>Binar Academy</h4>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>Front End Developer</h5>
                            </Cell>
                        </Grid>

                        <hr
                            style={{
                            borderTop: '3px solid #e22947'
                        }}/>
                        <h3 className="judul">Certifications</h3>
                        <Grid>
                            <Cell col={4}>
                                <NavLink href="https://aspen.eccouncil.org/verify">
                                    <img src={cscu} height="70px" width="100px"></img>
                                </NavLink>
                            </Cell>
                            <Cell col={8}>
                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>EC-Council</h4>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>Certified Secure Computer User v2</h5>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>ECC78814255628</h5>

                            </Cell>
                        </Grid>

                        <Grid>
                            <Cell col={4}>
                                <NavLink
                                    href="https://www.certiport.com/Portal/Pages/CredentialVerification.aspx">
                                    <img src={microsoft} height="70px" width="100px"></img>
                                </NavLink>
                            </Cell>
                            <Cell col={8}>
                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>Microsoft</h4>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>Microsoft Technology Associate - Database Administration Fundamentals</h5>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>EoCo - XLRq</h5>
                            </Cell>
                        </Grid>

                        <hr
                            style={{
                            borderTop: '3px solid #e22947'
                        }}/>
