                            <Cell col={4}>
                                <img src={toyota} height="70px" width="120px"></img>
                            </Cell>
                            <Cell col={8}>
                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>
                                    Toyota Motor Manufacturing Indonesia
                                </h4>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>
                                    Press & Welding Division</h5>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>
                                    2008 - 2010</h5>
                            </Cell>
                            <Cell col={4}>
                                <img src={ahm} height="50px" width="120px"></img>
                            </Cell>
                            <Cell col={8}>
                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>Astra Honda Motor</h4>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>
                                    Die Casting Department</h5>
                                    <h5
                                    style={{
                                    marginTop: '0px'
                                }}>
                                    2011 - 2012</h5>

                            </Cell>
                            <Cell col={4}>
                                <img src={mii} height="50px" width="120px"></img>
                            </Cell>
                            <Cell col={8}>
                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>Mesin Isuzu Indonesia</h4>
                                <h5
                                    style={{
                                    marginTop: '0px'
                                }}>
                                    Assembly Department</h5>
                                    <h5
                                    style={{
                                    marginTop: '0px'
                                }}>
                                    2013 - 2015</h5>
                            </Cell>
                            <Cell col={4}>
                            <img src={atr} height="80px" width="90px"></img>
                            </Cell>
                            <Cell col={8}>
                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>Ministry of Agrarian and Spatial Planning / National Land Agency</h4>
                                <h4
                                    style={{
                                    marginTop: '0px'
                                }}>2016 - Now</h4>
                            </Cell>

                        </Grid>
                    </Cell>
                </Grid>
            </div>
        )
    }

}

